import React, { useState, useEffect } from 'react';
const AboutUs = () => {


  //Our Info
    const [aboutUsData, setAboutUsData] = useState({
    names: "",
    about: "",
  });

 useEffect(() => {
        fetch('/teaminfo').then((res) =>
            res.json().then((data) => {
                setAboutUsData({
                    names: data.names,
                    about: data.about,
                });
            })
        );
    }, []);


    return (
        <div>

            <h1>About Us</h1>
            <h1>Team info:</h1>
            <p>{aboutUsData.names}</p>
            <p>{aboutUsData.about}</p>



        </div>
    );
}
export default AboutUs;
